import React from 'react';

function TodoItem({todo}) {
  const todoItemStyle = {
    background: '#ccc',
    padding: '5px 5px',
    width: '100%',
    fontSize: '4rem'
  };
  return (
    <div className={todoItemStyle}>
      {todo.text}
    </div>
  )
}

export default TodoItem;
